import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Reports = () => {
    const [reports, setReports] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [dateRange, setDateRange] = useState({
        startDate: '',
        endDate: ''
    });

    useEffect(() => {
        fetchReports();
    }, []);

    const fetchReports = async () => {
        try {
            const token = localStorage.getItem('token');
            const response = await axios.get('http://localhost:5000/api/reports', {
                headers: { Authorization: `Bearer ${token}` }
            });
            setReports(response.data);
            setLoading(false);
        } catch (err) {
            setError('Failed to fetch reports');
            setLoading(false);
        }
    };

    const handleGenerateReport = async (e) => {
        e.preventDefault();
        setLoading(true);
        try {
            const token = localStorage.getItem('token');
            const response = await axios.post('http://localhost:5000/api/reports/generate', 
                dateRange,
                { headers: { Authorization: `Bearer ${token}` } }
            );
            setReports([...reports, response.data]);
            setDateRange({ startDate: '', endDate: '' });
        } catch (err) {
            setError('Failed to generate report');
        } finally {
            setLoading(false);
        }
    };

    if (loading) return <div className="loading">Loading reports...</div>;
    if (error) return <div className="error-message">{error}</div>;

    return (
        <div className="page-container">
            <div className="page-header">
                <h1>Carbon Emission Reports</h1>
                <p className="page-subtitle">Generate and view your emission reports</p>
            </div>

            <div className="reports-container">
                <div className="report-form-card">
                    <h3>Generate New Report</h3>
                    <form onSubmit={handleGenerateReport} className="report-form">
                        <div className="form-group">
                            <label>Start Date</label>
                            <input
                                type="date"
                                value={dateRange.startDate}
                                onChange={(e) => setDateRange({...dateRange, startDate: e.target.value})}
                                required
                            />
                        </div>
                        <div className="form-group">
                            <label>End Date</label>
                            <input
                                type="date"
                                value={dateRange.endDate}
                                onChange={(e) => setDateRange({...dateRange, endDate: e.target.value})}
                                required
                            />
                        </div>
                        <button type="submit" className="btn btn-primary">
                            Generate Report
                        </button>
                    </form>
                </div>

                <div className="reports-list">
                    <h3>Previous Reports</h3>
                    {reports.length === 0 ? (
                        <p>No reports available</p>
                    ) : (
                        reports.map((report, index) => (
                            <div key={index} className="report-card">
                                <div className="report-header">
                                    <h4>Report #{report.id}</h4>
                                    <span>{new Date(report.date).toLocaleDateString()}</span>
                                </div>
                                <div className="report-details">
                                    <p>Total Emissions: {report.totalEmissions} kg CO2</p>
                                    <p>Period: {report.startDate} - {report.endDate}</p>
                                </div>
                            </div>
                        ))
                    )}
                </div>
            </div>
        </div>
    );
};

export default Reports;
